  getAllInformes(): void {
    const idPersona1 = this.authService.getIdEmpleadoFromToken();
    this.idPersona=parseInt(idPersona1!,10);
    //console.log(this.idPersona);
    //Se debe crear una funcion para informes para jalar informes
    this.informesIDService.getInformesPorEmpleado(this.idPersona).subscribe(
      data => {
        this.informes = data;
        this.calculateTotalPages();
        this.updateDisplayedData();
      }, error => {
        console.error(error);
      }
    );
  }
  getPaginationArray(): number[] {
    const totalPages = this.getTotalPages(); 
    return Array.from({ length: totalPages }, (_, index) => index + 1);
  }

  getTotalPages(): number {
    return 10; 
  }

  calculateTotalPages() {
    this.totalPages = Math.ceil(this.informes.length / this.itemsPerPage);
  }

  updateDisplayedData() {
    const startIndex = (this.currentPage - 1) * this.itemsPerPage;
    const endIndex = startIndex + this.itemsPerPage;
    this.informes12 = this.informes.slice(startIndex, endIndex);
  }

  onPageChange(page: number) {
    this.currentPage = page;
    this.updateDisplayedData();
  }

